import {Carousel}  from 'antd';

const HomePage = props => (


    <Carousel autoplay>
        <div>
            <h3> <link rel="shortcut icon" href="./imgs/logo.png" /></h3>
        </div>
        <div>
            <h3>2</h3>
        </div>
        <div>
            <h3>3</h3>
        </div>
        <div>
            <h3>4</h3>
        </div>
    </Carousel>
);









export default HomePage;
